  return (
    <main>
      <div>
      <Head>
        <title>Ollie the spot</title>
        <meta name="viewport" content="initial-scale=1.0, width=device-width" />
        <link href='https://api.mapbox.com/mapbox-gl-js/v0.53.0/mapbox-gl.css' rel='stylesheet' />
      </Head>
      <p>Hello world!</p>
    </div>
      <Header />
      <Form />
      <style jsx global>{`
      *, h1{
      font-size:16px;
      }
    `}</style>
    </main>
  );
}

export default Index;
